description:
A man goes on the run after he discovers that he is actually a &quot;harvested being&quot;, and is being kept along with others in a utopian facility.

Lincoln Six-Echo is a resident of a seemingly utopian but contained facility in the mid-21st century. Lincoln soon discovers that his existence is a lie. He makes a daring escape with fellow resident Jordan Two-Delta and they engage in a race for their lives...

